  "vs/platform/extensions/common/extensionsRegistry": ["Per le estensioni di Visual Studio Code consente di specificare la versione di Visual Studio Code con cui è compatibile l'estensione. Non può essere *. Ad esempio: ^0.10.5 indica la compatibilità con la versione minima 0.10.5 di Visual Studio Code.", "Editore dell'estensione Visual Studio Code.", "Nome visualizzato per l'estensione usato nella raccolta di Visual Studio Code.", "Categorie usate dalla raccolta di Visual Studio Code per definire la categoria dell'estensione.", "Banner usato nel marketplace di Visual Studio Code.", "Colore del banner nell'intestazione pagina del marketplace di Visual Studio Code.", "Tema colori per il tipo di carattere usato nel banner.", "Tutti i contributi dell'estensione Visual Studio Code rappresentati da questo pacchetto.", "Imposta l'estensione in modo che venga contrassegnata come Anteprima nel Marketplace.", "Eventi di attivazione per l'estensione Visual Studio Code.", "Un evento di attivazione emesso ogni volta che viene aperto un file che risolve nella lingua specificata.", "Un evento di attivazione emesso ogni volta che viene invocato il comando specificato.", "Un evento di attivazione emesso ogni volta che un utente sta per avviare il debug o sta per impostare le configurazioni di debug.", 'Un evento di attivazione emesso ogni volta che un "launch.json" deve essere creato (e tutti i metodi di provideDebugConfigurations devono essere chiamati).', "Un evento di attivazione emesso ogni volta che una sessione di debug di tipo specifico sta per essere lanciata (e un corrispondente metodo resolveDebugConfiguration deve essere chiamato).", "Un evento di attivazione emesso ogni volta che si apre una cartella che contiene almeno un file corrispondente al criterio GLOB specificato.", "Un evento di attivazione emesso ogni volta che la visualizzazione specificata viene espansa.", "Un evento di attivazione emesso all'avvio di VS Code. Per garantire la migliore esperienza per l'utente finale, sei pregato di utilizzare questo evento di attivazione nella tua estensione solo quando nessun'altra combinazione di eventi di attivazione funziona nel tuo caso.", "Matrice di notifiche da visualizzare nella barra laterale della pagina delle estensioni del Marketplace.", "URL di immagine della notifica.", "Collegamento della notifica.", "Descrizione della notifica.", "Dipendenze ad altre estensioni. L'identificatore di un'estensione è sempre ${publisher}.${name}. Ad esempio: vscode.csharp.", "Script eseguito prima che il pacchetto venga pubblicato come estensione Visual Studio Code.", "Percorso di un'icona da 128x128 pixel."],
  "vs/platform/extensions/node/extensionValidator": ["Non è stato possibile analizzare il valore {0} di `engines.vscode`. Usare ad esempio: ^0.10.0, ^1.2.3, ^0.11.0, ^0.10.x e così via.", "La versione specificata in `engines.vscode` ({0}) non è abbastanza specifica. Per le versioni di vscode precedenti alla 1.0.0, definire almeno le versioni principale e secondaria desiderate, ad esempio ^0.10.0, 0.10.x, 0.11.0 e così via.", "La versione specificata in `engines.vscode` ({0}) non è abbastanza specifica. Per le versioni di vscode successive alla 1.0.0, definire almeno la versione principale desiderata, ad esempio ^1.10.0, 1.10.x, 1.x.x, 2.x.x e così via.", "L'estensione non è compatibile con Visual Studio Code {0}. Per l'estensione è richiesto: {1}.", "La descrizione dell'estensione restituita è vuota", "la proprietà `{0}` è obbligatoria e deve essere di tipo `string`", "la proprietà `{0}` è obbligatoria e deve essere di tipo `string`", "la proprietà `{0}` è obbligatoria e deve essere di tipo `string`", "la proprietà `{0}` è obbligatoria e deve essere di tipo `object`", "la proprietà `{0}` è obbligatoria e deve essere di tipo `string`", "la proprietà `{0}` può essere omessa o deve essere di tipo `string[]`", "la proprietà `{0}` può essere omessa o deve essere di tipo `string[]`", "le proprietà `{0}` e `{1}` devono essere specificate o omesse entrambi", "la proprietà `{0}` può essere omessa o deve essere di tipo `string`", "Valore previsto di `main` ({0}) da includere nella cartella dell'estensione ({1}). L'estensione potrebbe non essere più portatile.", "le proprietà `{0}` e `{1}` devono essere specificate o omesse entrambi", "La versione dell'estensione non è compatibile con semver."],
