  "vs/platform/jsonschemas/common/jsonValidationExtensionPoint": ["Configurazione dello schema JSON per contributes.", 'Criteri dei file da soddisfare, ad esempio "package.json" o "*.launch".', "URL dello schema ('http:', 'https:') o percorso relativo della cartella delle estensioni ('./').", "'configuration.jsonValidation' deve essere una matrice", "'configuration.jsonValidation.fileMatch' deve essere definito", "'configuration.jsonValidation.url' deve essere un URL o un percorso relativo", "'configuration.jsonValidation.url' è un URL relativo non valido: {0}", "'configuration.jsonValidation.url' deve iniziare con 'http:', 'https:' o './' per fare riferimento agli schemi presenti nell'estensione"],
