  "vs/platform/markers/common/problemMatcher": ["La proprietà loop è supportata solo sul matcher dell'ultima riga.", "Nel criterio del problema manca un'espressione regolare.", "Il criterio del problema non è valido. Deve includere almeno un gruppo di corrispondenze di tipo file, messaggio e riga o posizione.", "Errore: la stringa {0} non è un'espressione regolare valida.\n", "Espressione regolare per trovare un messaggio di tipo errore, avviso o info nell'output.", "Indice del gruppo di corrispondenze del nome file. Se omesso, viene usato 1.", "Indice del gruppo di corrispondenze della posizione del problema. I criteri di posizione validi sono: (line), (line,column) e (startLine,startColumn,endLine,endColumn). Se omesso, si presuppone che sia impostato su (line,column).", "Indice del gruppo di corrispondenze della riga del problema. Il valore predefinito è 2", "Indice del gruppo di corrispondenze del carattere di riga del problema. Il valore predefinito è 3", "Indice del gruppo di corrispondenze della riga finale del problema. Il valore predefinito è undefined", "Indice del gruppo di corrispondenze del carattere di fine riga del problema. Il valore predefinito è undefined", "Indice del gruppo di corrispondenze della gravità del problema. Il valore predefinito è undefined", "Indice del gruppo di corrispondenze del codice del problema. Il valore predefinito è undefined", "Indice del gruppo di corrispondenze del messaggio. Se omesso, il valore predefinito è 4 se si specifica la posizione; in caso contrario, il valore predefinito è 5.", "In un matcher di più righe il ciclo indica se questo criterio viene eseguito in un ciclo finché esiste la corrispondenza. Può essere specificato solo come ultimo criterio in un criterio su più righe.", "Nome del criterio di problema.", "Nome del criterio di problema a più righe.", "Criteri effettivi.", "Aggiunge come contributo i criteri di problema", "Il criterio di problema non è valido e verrà ignorato.", "Il criterio di problema non è valido e verrà ignorato.", "Errore: la descrizione non può essere convertita in un matcher problemi:\n{0}\n", "Errore: la descrizione non definisce un criterio problema valido:\n{0}\n", "Errore: la descrizione non definisce un proprietario:\n{0}\n", "Errore: la descrizione non definisce un percorso file:\n{0}\n", "Info: gravità {0} sconosciuta. I valori validi sono errore, avviso e info.\n", "Errore: il criterio con identificatore {0} non esiste.", "Errore: la proprietà del criterio fa riferimento a un identificatore vuoto.", "Errore: la proprietà {0} del criterio non è un nome di variabile criterio valido.", "Un matcher problemi deve definire un criterio di inizio e un criterio di fine per il controllo.", "Errore: la stringa {0} non è un'espressione regolare valida.\n", "L'espressione regolare per rilevare l'inizio o la fine di un'attività in background.", "Indice del gruppo di corrispondenze del nome file. Può essere omesso.", "Nome di un criterio predefinito o aggiunto come contributo", "Criterio di problema o nome di un criterio di problema predefinito o aggiunto come contributo. Può essere omesso se si specifica base.", "Nome di un matcher problemi di base da usare.", "Proprietario del problema in Visual Studio Code. Può essere omesso se si specifica base. Se è omesso e non si specifica base, viene usato il valore predefinito 'external'.", "Gravità predefinita per i problemi di acquisizione. Viene usato se il criterio non definisce un gruppo di corrispondenze per la gravità.", "Controlla se un problema segnalato in un documento di testo è valido solo per i documenti aperti o chiusi oppure per tutti i documenti.", "Consente di definire come interpretare i nomi file indicati in un criterio di problema.", "Criteri per tenere traccia dell'inizio e della fine di un matcher attivo su un'attività in background.", "Se impostato a true, il monitor in backbround è in modalità attiva quando l'attività inizia. Equivale a inviare una riga che corrisponde al beginPattern", "Se corrisponde nell'output, viene segnalato l'avvio di un'attività in background.", "Se corrisponde nell'output, viene segnalata la fine di un'attività in background.", "La proprietà watching è deprecata. In alternativa, utilizzare background (sfondo).", "Criteri per tenere traccia dell'inizio e della fine di un matcher watching.", "Se impostato su true, indica che il watcher è in modalità attiva all'avvio dell'attività. Equivale a inviare una riga che corrisponde al criterio di avvio", "Se corrisponde nell'output, viene segnalato l'avvio di un'attività di controllo.", "Se corrisponde nell'output, viene segnalata la fine di un'attività di controllo.", "Questa proprietà è deprecata. In alternativa, usare la proprietà watching.", "Espressione regolare con cui viene segnalato l'avvio dell'esecuzione di un'attività controllata attivato tramite il controllo dei file.", "Questa proprietà è deprecata. In alternativa, usare la proprietà watching.", "Espressione regolare con cui viene segnalato il termine dell'esecuzione di un'attività controllata.", "Nome del matcher problemi utilizzato per riferirsi ad esso.", "Un'etichetta leggibile del matcher problemi.", "Aggiunge come contributo i matcher problemi", "Problemi del compilatore di Microsoft", "Problemi Less", "Problemi TSC Gulp", "Problemi JSHint", "Problemi di stile di JSHint", "Problemi di compattazione di ESLint", "Problemi di stile di ESLint", "Problemi di Go"],
