  "vs/workbench/parts/cli/electron-browser/cli.contribution": ["Installa il comando '{0}' in PATH", "Questo comando non è disponibile", "Il comando della shell '{0}' è stato installato in PATH.", "Visual Studio Code eseguirà 'osascript' per richiedere i privilegi di amministratore per installare il comando della shell.", "OK", "Non è possibile creare '/usr/local/bin'.", "Annulla", "Operazione interrotta", "Disinstalla il comando '{0}' da PATH", "Questo comando non è disponibile", "Il comando della shell '{0}' è stato disinstallato da PATH.", "Comando della shell"],
  "vs/workbench/parts/codeEditor/electron-browser/accessibility": ["Modifica dell'impostazione 'editor.accessibilitySupport' a 'on' in corso.", "Apertura della pagina di documentazione sull'accessibilità di VS Code in corso.", "Grazie per aver provato le opzioni di accessibilità di Visual Studio Code.", "Stato:", "Premere Comando+E per configurare l'editor per essere definitivamente ottimizzato per l'utilizzo con un un'utilità per la lettura dello schermo.", "Premere Control+E per configurare l'editor per essere definitivamente ottimizzato per l'utilizzo con un un'utilità per la lettura dello schermo.", "L'editor è configurato per utilizzare le API della piattaforma per rilevare quando è collegata un'utilità per la lettura dello schermo ma il runtime corrente non lo supporta.", "L'editor ha rilevato automaticamente che è collegata un'utilità per la lettura dello schermo.", "L'editor è configurato per rilevare automaticamente quando è collegata un'utilità per la lettura dello schermo, che non è collegata in questo momento.", "L'editor è configurato per essere definitivamente ottimizzato per l'utilizzo con un'utilità per la lettura dello schermo - è possibile modificare questo modificando l'impostazione 'editor.accessibilitySupport'.", "L'editor è configurato per non essere ottimizzato per l'utilizzo con un'utilità per la lettura dello schermo.", "Premere TAB nell'editor corrente per spostare lo stato attivo sull'elemento con stato attivabile successivo. Per attivare/disattivare questo comportamento, premere {0}.", "Premere TAB nell'editor corrente per spostare lo stato attivo sull'elemento con stato attivabile successivo. Il comando {0} non può essere attualmente attivato con un tasto di scelta rapida.", "Premere TAB nell'editor corrente per inserire il carattere di tabulazione. Per attivare/disattivare questo comportamento, premere {0}.", "Premere TAB nell'editor corrente per inserire il carattere di tabulazione. Il comando {0} non può essere attualmente attivato con un tasto di scelta rapida.", "Premere Comando+H per aprire una finestra del browser con maggiori informazioni relative all'accessibilità di VS Code.", "Premere Control+H per aprire una finestra del browser con maggiori informazioni relative all'accessibilità di VS Code.", "Per chiudere questa descrizione comando e tornare all'editor, premere ESC o MAIUSC+ESC.", "Visualizza la Guida sull'accessibilità"],
  "vs/workbench/parts/codeEditor/electron-browser/inspectKeybindings": ["Sviluppatore: controlla mapping tasti"],
  "vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint": ["Errori durante l'analisi di {0}: {1}", "Sequenza di stringa o carattere parentesi quadra di apertura.", "Sequenza di stringa o carattere parentesi quadra di chiusura.", "Definisce i simboli di commento", "Definisce il modo in cui sono contrassegnati i commenti per il blocco.", "Sequenza di caratteri che indica l'inizio di un commento per il blocco.", "Sequenza di caratteri che termina i commenti per il blocco.", "Sequenza di caratteri che indica l'inizio di un commento per la riga.", "Definisce i simboli di parentesi quadra che aumentano o riducono il rientro.", "Definisce le coppie di parentesi quadre. Quando viene immessa una parentesi quadra di apertura, quella di chiusura viene inserita automaticamente.", "Definisce un elenco di ambiti in cui la corrispondenza automatica delle coppie è disabilitata.", "Definisce le coppie di parentesi quadre che possono essere usate per racchiudere una stringa selezionata.", "La definizione di parola per il linguaggio.", "Il modello di RegExp utilizzato per trovare parole.", "I flag di RegExp utilizzati per trovare parole.", "Deve corrispondere al modello `/^([gimuy]+)$/`.", "Impostazioni di rientro del linguaggio.", "Se una riga corrisponde a questo criterio, tutte le linee successive devono essere rientrate una volta (fino alla corrispondenza di un'altra regola).", "Criterio di RegExp per increaseIndentPattern.", "Flag di RegExp per increaseIndentPattern.", "Deve corrispondere al modello `/^([gimuy]+)$/`.", "Se una riga corrisponde a questo criterio, il rientro di tutte le linee successive verrà ridotto una volta (fino alla corrispondenza di un'altra regola).", "Criterio di RegExp per decreaseIndentPattern.", "Flag di RegExp per decreaseIndentPattern.", "Deve corrispondere al modello `/^([gimuy]+)$/`.", "Se una riga corrisponde a questo criterio, il rientro verrà applicato una sola volta **solo alla riga successiva**.", "Criterio di RegExp per indentNextLinePattern.", "Flag di RegExp per indentNextLinePattern.", "Deve corrispondere al modello `/^([gimuy]+)$/`.", "Se una riga corrisponde a questo criterio, il rientro non deve essere modificato e la riga non deve essere valutata rispetto alle altre regole.", "Criterio di RegExp per unIndentedLinePattern.", "Flag di RegExp per unIndentedLinePattern.", "Deve corrispondere al modello `/^([gimuy]+)$/`.", "Impostazioni di riduzione del codice del linguaggio.", "Un linguaggio è conforme alla regola di offside se i blocchi in tale linguaggio vengono espressi in base al relativo rientro. Se questa opzione è impostata, le righe vuote appartengono al blocco successivo.", "Marcatori di riduzione del codice specifici del linguaggio, come '#region' e '#endregion'. Le espressioni regolari di inizio e fine verranno confrontate con il contenuto di tutte le righe e devono essere progettate in modo efficace", "Criterio di espressione regolare per il marcatore di inizio. L'espressione regolare deve iniziare con '^'.", "Criterio di espressione regolare per il marcatore di fine. L'espressione regolare deve iniziare con '^'."],
